/*
select 
  nmfdv2.BATCH_NAME,
  min(nmfdv2.SCAN_DT),
  min(nmfdv2.CREATE_DT),
  'update CORP_ETL_MFB_BATCH_STG set CREATE_DT = to_date(''' || min(nmfdv2.SCAN_DT) || ''',''YYYY-MM-DD HH24:MI:SS''), BATCH_COMPLETE_DT = to_date(''' || min(nmfdv2.CREATE_DT) || ''',''YYYY-MM-DD HH24:MI:SS''), COMPLETE_DT = null where BATCH_NAME = ''' || nmfdv2.BATCH_NAME || ''';', 
