from D_NYHIX_MFD_CURRENT_V2 nmfdv2
where nmfdv2.BATCH_NAME in (
  '164528-3/23/2015-3:55:29 PM-45408',
  '164524-3/23/2015-3:53:59 PM-45408',
  ...
)
group by nmfdv2.BATCH_NAME
order by min(nmfdv2.SCAN_DT) asc;
*/

